	var map = new L.Map("mapContainer", {
				center: [-3.170458, 120.716895], 
				zoom: 5,
			});
		
	var tile1 = L.tileLayer('http://korona.geog.uni-heidelberg.de/tiles/roads/x={x}&y={y}&z={z}', {
						attribution: ''
						}),
		
		tile2 = L.tileLayer('http://server.arcgisonline.com/ArcGIS/rest/services/World_Topo_Map/MapServer/tile/{z}/{y}/{x}', {
						attribution: ''
						});
		
		tile2.addTo(map);
			
	var layerControlItems = {
			  "<div class='layer-titles'> Roads </div>": tile1,
			  "<div class='layer-titles'> Topology </div>": tile2
			};
		
		 L.control.layers(layerControlItems).addTo(map);
	
	map.scrollWheelZoom.disable();
	map.touchZoom.disable();


	var svg = d3.select(map.getPanes().overlayPane).append("svg"),
		g = svg.append("g").attr("class", "leaflet-zoom-hide");

	//svg.attr("width", 500).attr("height", 500);

	function projectPoint(x, y) {
		var point = map.latLngToLayerPoint(new L.LatLng(y, x)); 
		this.stream.point(point.x, point.y); 

	}
	var transform = d3.geo.transform({point: projectPoint}),
		path = d3.geo.path().projection(transform);

	var indo;

	function loadPolygons(){

		  
		  	  indo = adm0;
		  	 
		  
			  g.selectAll("path")
				   .data(adm0.features)
				   .enter()
				   .append("path")
				   .attr("d", path)
				   .attr("fill", 'none')
				   .style("stroke","black")
				   .style("stroke-width",0.8)
				   .style("opacity",1);
				
				var bounds = path.bounds(boundJson),
					topLeft = bounds[0],
					bottomRight = bounds[1];
				
				console.log(topLeft[0]);
				
				 svg.attr("width", bottomRight[0] - topLeft[0])
					.attr("height", bottomRight[1] - topLeft[1])
					.style("left", topLeft[0] + "px")
					.style("top", topLeft[1] + "px");

				 g.attr("transform", "translate(" + -topLeft[0] + "," + -topLeft[1] + ")");
		
		
	
	}


	loadPolygons();
	drawSites();
	map.on("viewreset", resetView);
	
	
	function getOverlayG() {
		return g;
	}
	
	function getProjection() {
		return function(xy){ return map.latLngToLayerPoint(new L.LatLng(xy[1], xy[0])) };
	}
	
	function drawSites(){
	
		console.log("drawSites()");
		sites = g.append("g");
	
	
		sites.selectAll("circle")
	        .data(dataset)
	        .enter()
	        .append("circle")
	        .attr("r", 6)
			.attr("fill", "#F3CBAD")
	        .style("stroke", "black")
	        .classed("point", true)
	        .attr('cx',function(d){
					return getProjection()([d.longitude,d.latitude]).x;
				})
			.attr('cy',function(d){
					return getProjection()([d.longitude,d.latitude]).y;
				})
			.on("mouseover.border",function(){
				d3.select(this)
				.transition()
				.duration(1000)
				.style({
					'stroke-width':6,
					'stroke-opacity':0.3,
					'fill-opacity':1,
					'stroke':'black',
					'cursor':'pointer'
					});
			})
			.on("mouseout.border",function(){
				d3.select(this)
				.transition()
				.duration(2000)
				.style({
					'stroke-width':1,
					'stroke-opacity':1,
					'fill-opacity':1,
					'stroke':'black'
					});
			})
			.on("mouseover",drawInfolabel)
			.on("mouseout",removeInfolabel)
			.on("click",drawInfopanel)
			.each(function(){
				return this.parentNode.appendChild(this);
			});
	
	}
	
	
	function removeSites(){
		sites.selectAll("circle").remove();
	}




	function resetView() {
	
			if (indo) {
				var bounds = path.bounds(boundJson),
					topLeft = bounds[0],
					bottomRight = bounds[1];
				

				svg.attr("width", bottomRight[0] - topLeft[0] + 1000)
						.attr("height", bottomRight[1] - topLeft[1])
						.style("left", topLeft[0] + "px")
						.style("top", topLeft[1] + "px");

				g.attr("transform", "translate(" + -topLeft[0] + "," + -topLeft[1] + ")");

				g.selectAll('path').attr("d", path);		
			}
				removeSites();
				drawSites();
				
	}
	
	
	
